import React from 'react';
import logo from '../Netflix_2015_logo.svg';

const Header = () => {
    return (
        <div className="ui massive inverted menu">
            <div className="ui container">  
                <div className="item massive" style={{padding:0, width:100+'px'}}>              
                    <img src={logo} alt="NETFLIX" style={{width:100+'%'}} />  
                </div>
            </div>
        </div>              

    )
}

export default Header;
